import Layout from "../components/Layout";
import Feed from "../components/feed";
import Placard from "../components/placard";

import { makeStyles } from "@material-ui/core/styles";
import { Grid } from "@material-ui/core";

const useStyles = makeStyles({
  leftSideNav: {
    width: "16%",
    height: "100%",
    position: "fixed",
    //zIndex: 1,
    //left: 0,
    backgroundColor: "#eee",
    paddingTop: 60,
    overflowY: "auto",
  },

  rightSideNav: {
    width: "16%",
    height: "100%",
    position: "fixed",
    //zIndex: 1,
    //left: 0,
    backgroundColor: "#eee",
    paddingTop: 60,
    overflowY: "auto",
  },

  feed: {
    paddingTop: 80,
    marginLeft: 10,
    marginRight: 10,
  },
});

const Index = () => {
  const classes = useStyles();

  return (
    <Layout>
      <Grid container>
        <Grid item lg={1}></Grid>

        <Grid item lg={2}>
          <div className={classes.leftSideNav}>
            <Placard title="Talk with an expert" />
          </div>
        </Grid>

        <Grid item lg={6} style={{ backgroundColor: "#eee" }}>
          <div className={classes.feed}>
            <Feed />
          </div>
        </Grid>

        <Grid item lg={2}>
          <div className={classes.rightSideNav}>
            <Placard title="Did you know?" />
            <Placard title="FAQ" />
            <Placard title="Know the Law" />
          </div>
        </Grid>

        <Grid item lg={1}></Grid>
      </Grid>
    </Layout>
  );
};

export default Index;
